      table = ["「汚いトイレ。」指定特技は《探偵》。すごく不衛生な場所に背景が変更される。肥溜めと見まごうばかりのトイレか、肥溜めだ。臭いに耐えられるかどうか、そこが勝負の分かれ目だ！", "「芸術的陰部隠し。」指定特技は《跳ぶ》。全裸でシーンを過ごすが映ってはいけないものがある。本来なら水着の布地がある部分がカメラに映らないように、障害物を活用しろ！", "「触手。」指定特技は《ベルト》。唐突に触手怪獸が登場する。彼は紳士的だが容赦なく襲いかかってくるので、セクシーに負けろ！さもなくば観客はがっかりするだろう！", "「ヌルヌル。」指定特技は《トラッド》。なんだか粘液が入ったバケツが登場する。これを被ってシーンを始めろというのだ。成分もわからない粘液はイヤだが、なんとか耐えろ！", "「病原体を経口摂取する。」指定特技は《恐怖》。病気の原因になりそうなものを無理やり食べることに。具体的には排泄物や腐敗したもの、最初から不衛生なものなどだ。", "「局部へのひどい打撃。」指定特技は《死》。ヘルADや他の角色から局部を強打されることを強要される。死なずにうまく痛がれ。下手をするとショックでそのまま死ぬ！"];
